import React from 'react';
import '../App.js'

const Home = () => {
    return(
        <div style={{
            display: 'flex',
            justifyContent: 'Right',
            alignItems: 'Right',
            height: '100vh'
        }}
        >
            <h1>Welcome Home</h1>
        </div>
    )
}

export default Home;
